import React from 'react'

const  FormField = ({formdata,id}) => {

      const renderTemplate = () => {
        let formTemplate = null;

        switch(formdata.element){
          case('input'):
              formTemplate = (
                <div>
                  <input
                      {...formdata.config}
                      value={formdata.value}
                  />
                </div>
              )
          break;
          default:
              formTemplate = null;

        }
        return formTemplate
      }
  return (
    <div>
        {renderTemplate}
    </div>
  )
}

export default FormField;
